import './styles.css';
import React from 'react'
import * as selectors from '../../actions/babies'
import { connect } from 'react-redux';
import { getAllBabies } from '../../reducers/babies';

const Baby = ({babies,}) => (
    <div className="container">
        <div className="baby">
        <select id="cars" name="cars">
            {babies.forEach(baby => {
                <option value={baby[id]}>{baby[name]+" "+baby[lastname]}</option>
            })}
        </select>
        </div>
    </div>
)

export default connect(
    state => ({
        babies: getAllBabies(state)
    }),
    undefined
)(Baby)
